          "title": "Ferrari 296 GTB | La PROVA su strada di Masterpilot",
          "description": "L’arrivo della nuova Ferrari 296 GTB segna un vero e proprio punto di svolta nella produzione automobilistica firmata dalla Casa di Maranello. Sì perché se è vero che la Purosangue sarà qualcosa di inedito e “alieno” nella gamma rossa, è altrettanto vero che un motore V6…per giunta turbocompresso ha tutte le carte in regola per risultare ancora più indigesto ai puristi che non hanno ancora finito di chiacchierare sull’arrivo della SUV a quattro porte (le posteriori a favore di vento). \nDel resto quando si pensa a Ferrari si sognano prima di tutto i motori e se per la Sport Utility Vehicle è stato almeno mantenuto il V12 aspirato, fattore che la renderà unica e speciale nel panorama automobilistico mondiale, nella nuova Berlinetta si parla di un motore che sino ad oggi si era visto solo nella Dino (una NON Ferrari) e nei propulsori da competizione. Anzi, proprio il motore turbo della F1 di Arnoux aveva una configurazione molto simile a quella di questo nuova unità visto che l’angolo compreso tra le bancate è di 120°. Non parliamo mica di un “motorino”, dunque, ma di un pezzo di meccanica che una radice nella storia del Cavallino ce l’ha anche se in ambientazioni completamente diverse rispetto a quelle della strada, dove da sempre dominano i V12 ed i V8.\n\nI tempi però cambiano e partendo dall’esperienza maturata con il pluripremiato 3.9 V8 (v90°) F154, declinato in diversi livelli di potenza e installato anteriormente e centralmente in diversi prodotti della gamma, i tecnici Ferrari sono riusciti nell’impresa di dare vita al nuovo 2.992 cc della famiglia F163, che al suo primo stadio evolutivo eroga la bellezza di 663 CV (221 cv/litro) frutto di un alesaggio di 88 mm ed una corsa di 82 e del lavoro di due turbocompressori IHI con giranti montate su cuscinetti che lavorano in fase controrotante tra le bancate. Un motore compattissimo, estremamente leggero, in cui l’iniezione è curata attraverso l’uso di iniettori che lavorano a 350 bar con candele poste al centro delle camere di combustione.\n\nUn motore iper tecnologico in cui nulla è lasciato al caso, nemmeno le strategie di ibridazione che sono parte dello sviluppo di questo motore: si perché tra gli elementi che fanno storcere il naso ai “famosi” puristi c’è anche una sofisticata parte ibrida che scende direttamente dall’esperienza accumulata con la SF90 Stradale: ecco perché Ferrari dichiara per questa 296 GTB la bellezza di 830 CV…perché l’elettrico contribuisce alla spinta con 167 CV e 315 Nm di coppia massima che prendono energia da un pacco batterie agli ioni di litio posto dietro ai sedili (7,4 kWh) in grado di assicurare 25 km di autonomia in elettrico. Un motore che è in grado di spingere la vettura anche indipendentemente dal lavoro del V6 e che è pensato per contribuire alla spinta oltre che per recuperare energia in fase di frenata e di controllo di trazione. Sì, avete capito bene: controllo di trazione. Perché questa Ferrari, come la SF90 Stradale, gestisce questa fondamentale fase “prestazionale” con la frenatura del motore elettrico (recupera addirittura energia)…decisamente più efficace rispetto ai comunque presenti tagli sulla iniezione e sui freni. Più corta di passo rispetto alla F8/488 - 2.600 mm - la nuova 296 GTB è lunga 456 cm e pesa 1.470 kg: un peso piuma vista la cavalleria disponibile che per forza di cose richiede rigidità torsionali elevatissime alla scocca in alluminio ma anche un grande lavoro da parte di freni (Brembo carboceramici con pinza monoblocco anteriore a sei pistoncini) ruote, gomme, sospensioni e di tutto quello che contribuisce alla performance e che solamente qualche anno fa sarebbe passato in secondo piano. L’aerodinamica, per esempio, è curatissima ed oltre ad assicurare un drag molto ridotto la vettura è in grado di generare 350 kg di carico a 250 km/h senza eccedere in elementi alari che avrebbero “sporcato” il grande lavoro di stile compiuto da Flavio Manzoni: una piccola grande opera d’arte con una finitura degli elementi quasi scultorea che è tipica del suo modo di disegnare auto e sta diventando man mano parte dell’essere Ferrari. Che piaccia o meno.\n\n270.000 euro più accessori il prezzo di listino. Dieci per cento in più la variante “pista” Assetto Fiorano: non poco, soprattutto se si considera che la F8 era in listino a 230.000 euro circa, ma assolutamente giustificato dalla prestazione a dir poco stupefacente di questo “ferro” che il nostro Emiliano Perucca Orfei Masterpilot ha potuto provare nei dintorni di Maranello ed a Fiorano. Ecco come è andata…"
